import './App.css';
function Card({ title, content, picture }) {
    return (
        <div
            style={{
                display: "flex",            // Use flexbox to make sure the content aligns well
                flexDirection: "column",    // Ensure the content stacks vertically
                alignItems: "center",       // Center the content horizontally
                justifyContent: "center",   // Center the content vertically
                transition: "transform 0.2s ease-in-out",
                backgroundColor: "white",   // Make sure the background is white
                borderRadius: "10px",       // Optional: rounded corners
                padding: "20px",            // Add padding to the card for spacing
                border: "1px solid transparent",  // Remove border (we'll set this with hover)
                boxSizing: "border-box",    // Ensure that the scaling includes padding
            }}
            onMouseOver={(e) => e.currentTarget.style.transform = "scale(1.05)"}
            onMouseOut={(e) => e.currentTarget.style.transform = "scale(1)"}
        >
            {
                picture ? (
                    <img src={picture} alt={title} width="500" height="333"/>
                ) : (
                    <div style={{ fontSize: "100px", textAlign: "center" }}>ðŸ˜º</div>
                )
            }
            <h3>{title}</h3>
            <p>{content}</p>
        </div>
    );
}



function MiniCard({ title, content, link,}) {
    return (
        <div>
            <button style={{backgroundColor: "darkcyan", borderRadius: "8px", fontWeight: "lighter", color: "whitesmoke", padding: "15px 30px", border: "2px solid lightgray", border: "none"}}>
                <a href={link} style={{color: "#FFFFF0", fontWeight: "lighter"}}>{title}</a>
            </button>
        </div>
    );
}


function PinkCard({ title, content, link }) {
    return (
        <a href={link} style={{ textDecoration: "none" }} target="_blank" rel="noopener noreferrer">
            <div style={{ 
                border: "none", 
                padding: "20px", 
                margin: "10px", 
                borderRadius: "0px 15px 15px 0px", 
                backgroundColor: "rgb(247, 234, 236)", 
                borderLeft: "3px solid #FF5E00", 
                boxShadow: "0px 4px 5px rgba(0, 0, 0, 0.3)", 
                cursor: "pointer", 
                transition: "transform 0.2s ease-in-out",
                minHeight: "150px",
            }} 
            onMouseOver={(e) => e.currentTarget.style.transform = "scale(1.05)"} 
            onMouseOut={(e) => e.currentTarget.style.transform = "scale(1)"}>
                <h3 style={{ color: "#FF5E00" }}>{title}</h3>
                <p style={{ fontWeight: "normal", color: "black" }}>{content}</p>
            </div>
        </a>
    );
}

function TopBar() {
    return (
        <>
        <div className='background-color1'>
                <div style={{ display: "flex", flexDirection: "column", alignItems: "center", paddingRight: "1500px" }}>
                    <h2 className='muwatana-title-styling' style={{ marginTop: "5px" }}>muwatana</h2>
                    <small style={{ marginBottom: "20px" }}>learn to navigate the digital world safely</small>
                </div>
                <div className='navigation-tab-links'>
                    <p><a href="https://en.wikipedia.org/wiki/Main_Page" className="nav-link" style={{ margin: "10px" }}>About</a></p>
                    <p><a href="https://en.wikipedia.org/wiki/Main_Page" className="nav-link" style={{ margin: "10px" }}>Resources</a></p>
                    <p><a href="https://en.wikipedia.org/wiki/Main_Page" className="nav-link" style={{ margin: "10px", whiteSpace: "nowrap" }}>Digital Citizenship<br />Principles</a></p>
                    <p>
                        <a href="https://en.wikipedia.org/wiki/Main_Page" className='nav-link'>
                            <button style={{ color: "white", backgroundColor: "darkOrange", borderRadius: "20px", padding: "1px 20px", height: "30px", fontWeight: "lighter", margin: "10px", whiteSpace: "nowrap", border: "none" }}>
                                Contact ISF
                            </button>
                        </a>
                    </p>
                    <p>
                        <input placeholder="search this site...      ðŸ”" style={{ marginRight: "20px", width: "150px", height: "20px", borderRadius: "5px", border: "1px solid gray", marginLeft: "20px", padding: "5px" }} />
                    </p>
                    <span style={{ margin: "20px" }}>Ø§Ù„Ø¹Ø±Ø¨ÙŠØ©</span>
                </div>
            </div>

            <div style={{ display: "flex", flexDirection: "row", alignItems: "center", justifyContent: "center", minHeight: "100vh", textAlign: "center", gap: "40px" }}>
                <div>
                    <h1 style={{ fontSize: "45px" }}>Welcome to <br /> muwatana</h1>
                    <p>Learn how to stay safe online, spot <br /> fake news, balance screen time, <br /> guide children in the digital world</p>
                </div>
                <div>
                    <img src="apple.jpg" alt="Apple" width="500" height="333" />
                </div>
            </div></>
    );
}

export { MiniCard, PinkCard, TopBar};
export default Card;
